import React from "react";
import useTweets from "./utils/useTweets"

function App() {
const tweets = useTweets()

	return (
		//print out list of tweets in real-time as they are updated by useTweets hook
		// <div>
		// 	{tweets.map((tweet) => (
		// 		<p>{tweet.text}</p>
		// 	))}
		// </div>


		<div>
			<div class="container">
				<div id="tweetStream">
					{tweets.map((tweet) => (
						<div class="card-body">
							<h5 class="card-title">${tweet.text}</h5>
							<h6 class="card-subtitle mb-2 text-muted">${tweet.username}</h6>

							<a class="btn btn-primary mt-3" href="https://twitter.com/${tweet.username}/status/${tweet.id}">
								<i class = "fab fa-twitter"></i> Go To Tweet
							</a>
						</div>
					))}
				</div>
			</div>
		</div>
	);
}

export default App;
